import React from "react"

const Lista = (historial) => {
    return(<>
        <div id="sideBar">
            {historial.map(
                busqueda =>
                <div className="lineaLista">
                    {busqueda}
                </div>
            )}

        </div>

    </>)

}
export default  Lista
